import useFetch from '../../hooks/useFetch'
import { useUser } from '../../hooks/UserContext'
import './Profile.css'

function Profile() {
  const [user] = useUser()
  const users =  useFetch('http://127.0.0.1:3000/service/users')
  console.log(users)
  return (
    <div id="profile-id">
                {users?.map(u => 
                <p key={u.id}>{user && u.username}</p>
            )}
            </div>  
  )
}

export default Profile
